import React from "react";

const ChooseOperationComponent = props => {
    return (
        <div>
            <h4>ChooseOperationComponent.jsx</h4>
            <div className="X X-fd-column">
                <select name="operation-type" id="operation-type"
                // onChange={} value={""}
                >
                    <option value="">Select operation type</option>
                    <option value="createAccount">Create Account</option>
                    <option value="payment">Payment</option><option value="pathPaymentStrictSend">Path Payment Strict Send</option><option value="pathPaymentStrictReceive">Path Payment Strict Receive</option><option value="manageSellOffer">Manage Sell Offer</option><option value="manageBuyOffer">Manage Buy Offer</option><option value="createPassiveSellOffer">Create Passive Sell Offer</option><option value="setOptions">Set Options</option><option value="changeTrust">Change Trust</option><option value="allowTrust">Allow Trust</option><option value="accountMerge">Account Merge</option><option value="manageData">Manage Data</option><option value="bumpSequence">Bump Sequence</option><option value="createClaimableBalance">Create Claimable Balance</option><option value="claimClaimableBalance">Claim Claimable Balance</option><option value="beginSponsoringFutureReserves">Begin Sponsoring Future Reserves</option><option value="endSponsoringFutureReserves">End Sponsoring Future Reserves</option><option value="revokeSponsorship">Revoke Sponsorship</option><option value="clawback">Clawback</option><option value="clawbackClaimableBalance">Clawback Claimable Balance</option><option value="setTrustLineFlags">Set Trust Line Flags</option><option value="liquidityPoolDeposit">Liquidity Pool Deposit</option>
                    <option value="liquidityPoolWithdraw">Liquidity Pool Withdraw</option>
                </select>
            </div>
        </div>
    )
}
export default ChooseOperationComponent;
